BEGIN;
INSERT INTO "t_security_device" ("id", "name", "geo", "type", "manufacturer", "icon", "description", "related_assets", "related_assets_num", "add_screen", "create_time", "update_time") VALUES (112, '安恒全流量综合探针', '北京市/市辖区/西城区', '48,14', '安恒(DBAPPSecurity)', 'flm', '安恒全流量综合探针具备高性能抓包、协议解析、文件还原、杀毒引擎等高级威胁检测能力。是一个面向全流量安全分析、业务分析、审计分析的产品，可广泛适用于银行、公安、政府、运营商、电子商务、能源、企业等各行业的流量深度威胁监控与分析。', '', 0, 0, '2026-01-13 10:37:40+08', '2026-01-13 10:37:40+08');
INSERT INTO "t_security_device" ("id", "name", "geo", "type", "manufacturer", "icon", "description", "related_assets", "related_assets_num", "add_screen", "create_time", "update_time") VALUES (113, '安恒日志标准化引擎', '北京市/市辖区/西城区', '48,28', '安恒(DBAPPSecurity)', 'las', '安恒日志标准化引擎通过对客户网络设备、安全设备、主机和应用系统日志进行全面的标准化处理，及时发现各种安全威胁、异常行为事件，为管理人员提供全局的视角，确保客户业务的不间断运营安全。', '', 0, 0, '2026-01-13 10:37:40+08', '2026-01-13 10:37:40+08');
INSERT INTO "t_security_device" ("id", "name", "geo", "type", "manufacturer", "icon", "description", "related_assets", "related_assets_num", "add_screen", "create_time", "update_time") VALUES (114, '安恒WAF', '北京市/市辖区/西城区', '48,13', '安恒(DBAPPSecurity)', 'waf', '应用防火墙专注于网站及Web应用系统的应用层专业安全防护。可以快速地应对恶意攻击者对Web业务带来的冲击；可以智能锁定攻击者并通知管理员对网站代码进行合理的加固。', '', 0, 0, '2026-01-13 10:37:40+08', '2026-01-13 10:37:40+08');
INSERT INTO "t_security_device" ("id", "name", "geo", "type", "manufacturer", "icon", "description", "related_assets", "related_assets_num", "add_screen", "create_time", "update_time") VALUES (115, '安恒EDR', '北京市/市辖区/西城区', '48,56', '安恒(DBAPPSecurity)', 'edr', '主机安全及管理系统是一款集成了丰富的系统防护与加固、网络防护与加固等功能的主机安全产品。通过自主研发的文件诱饵引擎，有着业界领先的勒索专防专杀能力；通过内核级东西向流量隔离技术，实现网络隔离与防护；通过流量画像，实现全网流量可视化且支持一键阻断；拥有补丁修复、外设管控、文件审计、违规外联检测与阻断等主机安全能力。目前产品广泛应用在服务器、桌面PC、虚拟机、工控系统、国产操作系统、容器安全等各个场景。', '', 0, 0, '2026-01-13 10:37:40+08', '2026-01-13 10:37:40+08');
COMMIT;

