                                         "id" int8 NOT NULL,
                                         "awareness_id" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
                                         "title" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
                                         "brief" text COLLATE "pg_catalog"."default" NOT NULL,
                                         "create_time" timestamp,
                                         "update_time" timestamp
)
;
ALTER TABLE "t_situation_awareness" OWNER TO "dbapp";

-- ----------------------------
-- Records of t_situation_awareness
-- ----------------------------
BEGIN;
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (1, 'ExternalAttack', '外部攻击态势', '外部攻击态势主要关注来自全世界不同地区的攻击源对企业内部资产的威胁情况，实时监控境内境外攻击源的地域分布和国家排行，掌握各攻击链阶段的威胁变化趋势和最新外部攻击事件。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (2, 'CrossThreat', '横向威胁感知', '横向威胁感知主要关注企业内部资产之间的违规操作和病毒传播，实时监控跨安全域的访问行为和业务系统访问情况，通过自由布局和圆形布局观测资产之间的威胁关系，及时发现并制止违规资产对企业内网环境造成的破坏。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (3, 'AssetsConnection', '资产外连风险态势', '资产外连风险态势主要关注企业内网存在回连行为和对外攻击的风险资产，实时监控外连行为变化趋势、最新外连事件、外连目的国家等，掌握企业内部资产的C&C回连情况和远控团伙信息。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (4, 'Monitor', 'WEB安全态势', 'WEB安全态势监控WEB服务的被访问状态和受攻击情况，包括网站区域访问量，访问地区排行，攻击网站排行，攻击类型排行，网站访问和攻击变化趋势等。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (5, 'SafaWarn', '内网安全态势', '内网安全态势通过3D逻辑安全域展示网络系统内发生的安全事件的攻击路径、攻击手法和影响范围，支持关联用户的网络和安全域划分，支持根据具体的资产和安全域的方式告警，可以为用户提供攻击者的溯源信息以及安全事件的处置建议。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (6, 'AI_analysis', 'AI异常分析', 'AI异常分析将AI算法与观测指标结合发现网络中断异常活动和新型威胁，多种AI分析场景配合算法特征将实时数据、拟合数据、评价参数共同呈现。异常信息通过红色点或区域高亮标注，点击异常标注可弹出异常信息详情窗口，辅助用户进行分析钻取和异常定位。多场景异常分布情况通过泳道图汇总到同一时间轴，用户可及时感知某时刻安全风险的集中爆发。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (7, 'SherlockScreen', 'Sherlock大屏', '夏洛克(Sherlock)赋予你一双福尔摩斯的慧眼，帮你透视整个网络，追踪网络实体的连接关系，发现访问行为的蛛丝马迹。大数据标签画像分析寻找相似的受害团体和黑客组织，AI 算法加持发现 观测指标中隐藏的未知威胁，情报、弱点信息辅助安全事件的追根溯源。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (8, 'AssetsManageScreen', '资产态势感知', '资产态势感知通过资产卡片形式实时监控重大保障活动中的关键资产，利用标签切换不同的活动资产分组，及时发现并处置风险资产，保障用户业务的可持续平稳运行。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (9, 'TraceV2', '攻击者追踪溯源', '攻击者追踪溯源可视化分析大屏，为安全运维人员提供包括攻击行为分析、团伙分析、攻击取证信息、攻击趋势、攻击手段，攻击影响范围等信息，支持任意攻击者信息查询，可生成详细的攻击者溯源报告，并能够一键导出报告。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (10, 'AssetTrace', '资产威胁溯源', '资产威胁溯源可视化分析大屏，为安全运维人员提供包括被攻击行为分析、影响资产范围分析、攻击取证信息等，支持任意资产查询，可呈现被访问趋势、被攻击趋势、被攻击手段、资产状态，资产评分等信息。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (11, 'PortalScreen', '统一门户', '统一门户作为访问安全分析与管理平台中信息资源的统一入口，集成态势感知、业务拓扑、资产感知、威胁情报、通报预警等系统核心应用，总体提升企业安全运营和威胁应急响应工作效率。', '2026-01-13 10:37:41+08', NULL);
INSERT INTO "t_situation_awareness" ("id", "awareness_id", "title", "brief", "create_time", "update_time") VALUES (12, 'statusDetection', '平台运行状态监测', 'AiLPHA安全分析与管理平台运行状态监测，凸显AiLPHA具备来自全网安全设备的多元异构数据接入能力，打破数据孤岛，内置丰富的规则和知识库，利用多种计算分析引擎和安全分析工具，可长期保障用户全网资产安全，实时告警威胁情况。同时平台具备良好的数据存储和计算性能，支持动态扩容缩容，根据需求灵活配置。', '2026-01-13 10:37:41+08', NULL);
COMMIT;




