-- ----------------------------
-- Table structure for t_topology_business
-- ----------------------------
DROP TABLE IF EXISTS "t_topology_business";
CREATE TABLE "t_topology_business" (
                                       "id" varchar(100) COLLATE "pg_catalog"."default" NOT NULL,
                                       "businessname" varchar(25) COLLATE "pg_catalog"."default" NOT NULL,
                                       "description" varchar(500) COLLATE "pg_catalog"."default",
                                       "publish" int4 DEFAULT 1
)
;
ALTER TABLE "t_topology_business" OWNER TO "dbapp";
COMMENT ON COLUMN "t_topology_business"."id" IS '业务id';
COMMENT ON COLUMN "t_topology_business"."businessname" IS '业务名称';
COMMENT ON COLUMN "t_topology_business"."description" IS '业务描述';
COMMENT ON COLUMN "t_topology_business"."publish" IS '是否发布(1-发布;0-未发布)';

-- ----------------------------
-- Records of t_topology_business
-- ----------------------------
BEGIN;
INSERT INTO "t_topology_business" ("id", "businessname", "description", "publish") VALUES ('topo_business_a736d7b7_1536583387211', '通用Web应用', '通用Web应用架构，包含负载均衡、多个Web实例、主备数据库。将出口防火墙、WAF、数据库审计等安全设备的日志集中送到AiLPHA安全分析与管理平台，保障Web应用的业务可持续性运行。', 1);
INSERT INTO "t_topology_business" ("id", "businessname", "description", "publish") VALUES ('topo_business_b0676e54_1536223090273', '企业网(3D)', '企业网中包含办公区、DMZ区等网络安全域。将企业网中的防火墙、APT、全流量DPI等安全设备的日志集中送到AiLPHA安全分析与管理平台，保障企业办公网安全和商业机密数据安全。', 1);
INSERT INTO "t_topology_business" ("id", "businessname", "description", "publish") VALUES ('topo_business_ba97bc66_1536593671490', '企业网', '企业网中包含办公区、DMZ区等网络安全域。将企业网中的防火墙、APT、全流量DPI等安全设备的日志集中送到AiLPHA安全分析与管理平台，保障企业办公网安全和商业机密数据安全。企业网拓扑用于《深度威胁分析报告》', 1);
COMMIT;

